import React from 'react';
import './App.css';
import Form from './components/Form';
import Nav from './Nav';
import Map from './Map';
import Pollination from './Pollination'
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function App() {

  return (
    <Router>
    <div className='app'>
      <Nav />
      <Switch>
      <Route path='/polllination' component={Pollination} />
      <Route path='/map' component={Map} />
      </Switch>
           <Form />
    </div>
    </Router>
  );
}
export default App;
